import React, { Component } from "react";
import Col from "react-bootstrap/Col";
import Nav from "react-bootstrap/Nav";
import Row from "react-bootstrap/Row";
import Tab from "react-bootstrap/Tab";

export default class RankingSidebar extends Component {
  render() {
    return (
      <div class="ranking-sidebar ">
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <Nav variant="pills" className="flex-column">
            <Row>
              <Col>
                <Nav.Item>
                  <Nav.Link eventKey="first">
                    <span class="material-symbols-outlined">visibility</span>
                    TopLượt Xem
                  </Nav.Link>
                </Nav.Item>
              </Col>
              <Col>
                <Nav.Item>
                  <Nav.Link eventKey="second">Top Lưỡi Theo Dõi</Nav.Link>
                </Nav.Item>
              </Col>
            </Row>
          </Nav>
          <Tab.Content className="border">
            <Tab.Pane eventKey="first">dasd</Tab.Pane>
            <Tab.Pane eventKey="second">fasf</Tab.Pane>
          </Tab.Content>
        </Tab.Container>
      </div>
    );
  }
}
